func (a *OfficialCommonArea) AsRow(onlyFields ...string) param.Store {
	r := param.Store{}
	if len(onlyFields) == 0 {
		r["id"] = a.Id
		r["pid"] = a.Pid
		r["short"] = a.Short
		r["name"] = a.Name
		r["merged"] = a.Merged
		r["level"] = a.Level
		r["pinyin"] = a.Pinyin
		r["code"] = a.Code
		r["zip"] = a.Zip
		r["first"] = a.First
		r["lng"] = a.Lng
		r["lat"] = a.Lat
		r["country_abbr"] = a.CountryAbbr
		return r
	}
	for _, field := range onlyFields {
		switch field {
		case "id":
			r["id"] = a.Id
		case "pid":
			r["pid"] = a.Pid
		case "short":
			r["short"] = a.Short
		case "name":
			r["name"] = a.Name
		case "merged":
			r["merged"] = a.Merged
		case "level":
			r["level"] = a.Level
		case "pinyin":
			r["pinyin"] = a.Pinyin
		case "code":
			r["code"] = a.Code
		case "zip":
			r["zip"] = a.Zip
		case "first":
			r["first"] = a.First
		case "lng":
			r["lng"] = a.Lng
		case "lat":
			r["lat"] = a.Lat
		case "country_abbr":
			r["country_abbr"] = a.CountryAbbr
		}
	}
	return r
}

